import zen from 'zen';

/** @type {Handler} **/
export const handler = async (outputs) => {
  let totalScore = 0;
  let strikes = 0;
  let reject = false;

  outputs.forEach(output => {
    totalScore += output.score || 0;
    strikes += output.strike || 0;
    if (output.reject) {
      reject = true;
    }
  });

  let rag;
  if (totalScore >= 0) {
    rag = 'green';
  } else if (totalScore > -30) {
    rag = 'amber';
  } else {
    rag = 'red';
  }

  return {
    totalScore: totalScore,
    strikes: strikes,
    reject: reject,
    rag: rag
  };
};
